import {
	STATUS_COURSES,
	FETCH_OFFERED_COURSES,
	MESSAGE_COURSES,
} from 'constants/types/offered';

export const statusOfferedCourse = (status) => ({
	type: STATUS_COURSES,
	payload: status,
});

export const fetchOfferedCourse = (courses) => ({
	type: FETCH_OFFERED_COURSES,
	payload: courses,
});

export const messageOfferedCourse = (message) => ({
	type: MESSAGE_COURSES,
	payload: message,
});
